class Solution {
private:
    int n1, n2;
    
    bool canfinish(string& word1, int i1, string& word2, int i2, vector<int>& ans) {
        // cout << "canfinish i1 " << i1 << " i2 " << i2 << endl;
        // TODO see if we can remember the result like we have been here even at an earlier i1 and didn't find an answer
        
        
        
        if( i2 == n2 )
            return true;
        
        // TODO consider if there enough chars left in word1
        
        int left2 = n2 - i2; // there are left2 chars left in word2 including the char at i2
        
        
        
        while( i1 < n1 && n1 - i1 >= left2 && word1[i1] != word2[i2] )
            ++i1;
        
        if( i1 < n1 && word1[i1] == word2[i2] ) {
            ans.push_back(i1);
            bool f = canfinish(word1, i1+1, word2, i2+1, ans);
            if( f )
                return true;
            // backtrack
            ans.pop_back();
        }
        
        return false;
    }
    
public:
    vector<int> validSequence(string word1, string word2) {
        // word2.length < word1.length     
        
        n1 = word1.size(); // cout << "n1 " << n1 << endl;
        n2 = word2.size(); // cout << "n2 " << n2 << endl;
        
        vector<int> ans;
        
        int i1 = 0;
        int i2 = 0;
        
        for(; i2 < n2; ++i2) {
            
            // if word1[i1] == word2[i2] we take it 
            // if word1[i1] != word2[i2] we can use our one mismatch at i1
            //     but we have to match the rest from i1+1 and i2+1 w/o fail
            //     if success we are done
            //     if fail we advance in word1 till match 
            
            if( word1[i1] == word2[i2] ) {
                ans.push_back(i1);
                ++i1;
            
            } else {
                ans.push_back(i1);
                bool f = canfinish(word1, i1+1, word2, i2+1, ans);
                if( f )
                    break;
                ans.pop_back();
        
                // advance in word1 till match
                int left2 = n2 - i2; // there are left2 chars left in word2 including the char at i2
        
        
        
                while( n1 - i1 >= left2 && word1[i1] != word2[i2] )
                    ++i1;
        
                if( word1[i1] == word2[i2] ) {
                    ans.push_back(i1);
                    ++i1;
                } else {
                    return {};
                }
            }
        }
        
        
        return ans;
    }
};
